        <div>
          <Link to="/pokemon/add" className='btn-floating btn-large waves-effect waves-light red z-depth-3' style={{ position:'fixed', bottom:'25px', right:'25px'}}> + Add</Link>
        </div>
        </div>
      </div>
    </div> 
  );
}

export default PokemonList;
